import './App.css';
import { LoginPage } from './login';
import { Quizcustompage } from './quicklogin';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
       <Route exact path='/' element={<Quizcustompage />}></Route>
    </div>
    </Router>
  );
}

export default App;
